// @ts-nocheck
declare namespace java {
    namespace security {
        namespace cert {
            // @ts-ignore
             class CertificateException extends java.security.GeneralSecurityException {
                /**
                 * Constructs a certificate exception with no detail message. A detail
                 * message is a String that describes this particular exception.
                 */
                // @ts-ignore
                constructor()
                /**
                 * Constructs a certificate exception with the given detail
                 * message. A detail message is a String that describes this
                 * particular exception.
                 */
                // @ts-ignore
                constructor(msg: string)
                /**
                 * Creates a {@code CertificateException} with the specified
                 * detail message and cause.
                 */
                // @ts-ignore
                constructor(message: string, cause: java.lang.Throwable)
                /**
                 * Creates a {@code CertificateException} with the specified cause
                 * and a detail message of {@code (cause==null ? null : cause.toString())}
                 * (which typically contains the class and detail message of
                 * {@code cause}).
                 */
                // @ts-ignore
                constructor(cause: java.lang.Throwable)
            }
        }
    }
}
